import React, { Component } from 'react';
import { Route } from "react-router-dom";
import HomePage from "./Components/HomePage/HomePage";
import Main from "./Main";

export default function App() {




    return (
      <>
        <Route path="/" exact>
          <HomePage />
        </Route>
        <Route path="/gamepage">

          <Main />

        </Route>

      </>
    );
};
